import React from 'react'
import './index.scss';
import { FaUsers } from "react-icons/fa";
type Props={
    message:string,
}

const Nomeeting = (props:Props) => {
    const{message}=props
  return (
    <section className="no-meeting">
    <h1 className='img-card'>
      <span>
        <FaUsers />
      </span>
     {message}
    </h1>
  </section>
  )
}

export default Nomeeting
